import React from "react";

import { Helmet } from "react-helmet";
import Page from "react-page-loading";
import Slide from "react-reveal/Zoom";

import { MDBCol, MDBRow } from "mdbreact";

const Contact = () => {
  const contactPageTitle = "Contact/Amirreza Ghanei";

  return (
    <div className="div">
      <Helmet>
        <title>{contactPageTitle}</title>
      </Helmet>
      <Page loader={"bar"} color={"#17a2b8"} size={10} duration={2}>

        <div className="full">
          <MDBRow className="bad-gateway-row">
            <MDBCol md="8">
              <h2 className="h2-responsive mt-3 mb-2">404. That's an error.</h2>
              <h4>The requested URL was not found on this server.</h4>
            </MDBCol>
            <MDBCol md="4">
              <img
                alt="Error 404"
                className="img-fluid"
                src="https://mdbootstrap.com/img/Others/grafika404-bf.png"
              />
            </MDBCol>
          </MDBRow>
        </div>
      </Page>
    </div>
  );
};

export default Contact;
